const MyCard = () => {
  return (
    <div className="card d-flex justify-content-center align-items-center">
      <div className="imgbox  h-100 w-100">
        <img className="imgsize" src="http://placekitten.com/200/" alt="" />
      </div>
    </div>
  );
};

export default MyCard;
